import React from 'react';
import './App.css';
import * as clockFunction from './function';

function time() {
  var cuttentTime = document.getElementById('time');

  let setTime = today.toLocaleTimeString();

  if (!cuttentTime) {
    cuttentTime = document.getElementById('time');
    cuttentTime.innerHTML = setTime;
  }
  else {
    cuttentTime.innerHTML = setTime;
  }

}

function App() {
  return (
    <>
      <div className="clock">
        <div className="hourHand"></div>
        <div className="minuteHand"></div>
        <div className="secondHand"></div>
        <div className="center"></div>
        <div className="time" id="time">{clockFunction.time()}</div>

        <ul>
          <li><span>1</span></li>
          <li><span>2</span></li>
          <li><span>3</span></li>
          <li><span>4</span></li>
          <li><span>5</span></li>
          <li><span>6</span></li>
          <li><span>7</span></li>
          <li><span>8</span></li>
          <li><span>9</span></li>
          <li><span>10</span></li>
          <li><span>11</span></li>
          <li><span>12</span></li>
        </ul>
      </div>
    </>
  );
}

export default App;
